
public class RelationalOperations2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 23;
		int y = 23;
		System.out.println("x = 23 and y = 23");
		System.out.println("x == y: " + (x == y));
		System.out.println("x < y: " + (x < y));
		System.out.println("x <= y: " + (x <= y) );
		System.out.println("x >= y: " + (x >= y));
		System.out.println("x > y: " + (x > y));
		x = 56;
		y = 89;
		System.out.println("x = 56 and y = 89");
		System.out.println("x == y: " + (x == y));
		System.out.println("x < y: " + (x < y));
		System.out.println("x <= y: " + (x <= y) );
		System.out.println("x >= y: " + (x >= y));
		System.out.println("x > y: " + (x > y));
		x = 101;
		y = 48;
		System.out.println("x = 101 and y = 48");
		System.out.println("x == y: " + (x == y));
		System.out.println("x < y: " + (x < y));
		System.out.println("x <= y: " + (x <= y) );
		System.out.println("x >= y: " + (x >= y));
		System.out.println("x > y: " + (x > y));
	}

}
